  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from 'react-router-dom';

function App() {

  return (
    //class for html
    <>
      <Router>

        <ANavbar />
        <div className="App">
          <Routes>
            <Route path='/list' element={<List />} />
            {/* <Route path='/'>
